import React from 'react';

const Card = ({ item }) => {
  return (
    <div className="card">
      <h3>{item.name}</h3>
      <p>{item.description}</p>
      <p>Price: {item.price}</p>
      <img src={item.image} alt={item.name} />
    </div>
  );
};

export default Card;
